<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; color: #000000; font-family: Arial, sans-serif; font-size: 13.6px; text-align: justify; text-indent: 35.45pt;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-size: 14pt; line-height: 21.4667px; font-family: \'Times New Roman\', \'serif\';">M&ouml;vzu ətrafında hazırlanmış slayd m&uuml;şayiəti ilə ke&ccedil;irilən təlimdə iştirak&ccedil;ılara təqsirsizlik prezumpsiyası, həmin prinsipin tarixi və qanunvericiliyimizdəki yeri barədə geniş məlumat verildikdən sonra trаsоlоgiyаnın predmeti, əsaslandığı еlmi m&uuml;ddəаlаr, trasologiyada izlərin qrup təsnifatları ətraflı izah olunub.</span></p>
<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; color: #000000; font-family: Arial, sans-serif; font-size: 13.6px; text-align: justify; text-indent: 35.45pt;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-size: 14pt; line-height: 21.4667px; font-family: \'Times New Roman\', \'serif\';">Təlimdə iştirak&ccedil;ılar həm&ccedil;inin insan şəxsiyyətinin eyniləşdirilməsi məqsədilə aparılan daktiloskopik qeydiyyat, DNT tədqiqatının k&ouml;məyi ilə şəxsiyyətin eyniləşdirilməsi metodu ilə yanaşı аyаq və аyаqqаbı izinin еkspеrtizаsı, insаn diş, dоdаq və dırnаq izlərinin еkspеrtizаları, sındırmа аlət və vаsitələri izlərinin еkspеrtizаsı (mехаnоskоpik еkspеrtizа) ilə bağlı ətraflı məlumatlandırılmışlar.</span></p>
<p style="box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; color: #000000; font-family: Arial, sans-serif; font-size: 13.6px; text-align: justify; text-indent: 35.45pt;"><span style="box-sizing: border-box; margin: 0px; padding: 0px; font-size: 14pt; line-height: 21.4667px; font-family: \'Times New Roman\', \'serif\';"><img style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 5px; padding: 0px; max-width: 100%; height: auto; float: left;" src="http://alimehkemetest.nakhchivan.az/storage/news/June2022/11.05.2022.jpg" alt="11.05.2022" width="300" height="200" />Qeyd olunmuşdur ki, trasologiya həmişə ən perspektivli b&ouml;lmə olmuşdur. Məhkəmə təcr&uuml;bəsinin təhlili g&ouml;stərir ki, cinayətlərin b&ouml;y&uuml;k əksəriyyəti cinayətkarın ətraf m&uuml;hitlə fəal qarşılıqlı əlaqədə olduğu zaman baş verir. Əvvəlcə kriminalist texnikanın formalaşması zamanı iz təlimi əsas və həlledici rol oynayırdı. Hazırda kriminalistik texnika trasologiyanın indiki konsepsiyasını, onun a&ccedil;ılmamış potensialını, təkmilləşdirilmiş &uuml;sullarını və izlərin aşkar edilməsi və təsbit edilməsi &uuml;zrə son metodları yalnız tədris fənni kimi təkmilləşdirmir, həm də bunun nəticəsi olaraq cinayətlərin aşkarlanmasının səmərəliliyini artırır. Cinayətkarlığın və onun dinamikasının artımının m&uuml;şahidə olunduğu son illərdə cinayət m&uuml;hakimə icraatında elm və texnikanın nailiyyətlərinin əsas bələd&ccedil;isi olan kriminalistika və məhkəmə ekspertizalarının formalaşmasına və təkmilləşdirilməsinə daha &ccedil;ox zərurət var.<span style="box-sizing: border-box; margin: 0px; padding: 0px; font-size: 14pt; line-height: 21.4667px;">&nbsp;<img style="box-sizing: border-box; border: 0px; vertical-align: middle; margin: 5px; padding: 0px; max-width: 100%; height: auto; float: right;" src="http://www.supremecourt.nakhchivan.az/images/news/11.05.2022%20(4).JPG" alt="11.05.2022 (4)" width="300" height="200" /></span></span></p>
